import React from "react";
import MakeClaim from"./assets/images/MakeClaim.png";
const MakeCalm = () =>{
    return
    <div className="home_page">
        <div className="top_img">
        <img src={MakeClaim} alt="contactbanner"/>
        </div>
        </div>
};
export default MakeCalm;
